abstract contract BEP20Burnable is Context, ERC20 {
    function burn(uint256 value) public virtual {
        _burn(_msgSender(), value);
    }
}

contract Helder is ERC20, BEP20Burnable {
    uint256 private constant INITIAL_SUPPLY = 500_000_000;

    constructor(
        address recipient,
        address _owner,
        uint256 _amount
    ) ERC20("helder", "hldr", _owner, _amount) {
        _mint(recipient, INITIAL_SUPPLY * 10 ** decimals());
    }
}

